const questions = [
  {
    question: "Which platform is commonly used to deploy React frontend?",
    options: ["MongoDB Atlas", "Render", "MySQL", "Express"],
    answer: "Render"
  },
  {
    question: "Which command is used to create production build?",
    options: ["npm start", "npm run build", "node server.js", "git push"],
    answer: "npm run build"
  },
  {
    question: "React frontend deployment is usually:",
    options: ["Dynamic Hosting", "Static Hosting", "Database Hosting", "Backend Hosting"],
    answer: "Static Hosting"
  },
  {
    question: "Which file contains React root div?",
    options: ["App.js", "index.html", "server.js", "package.json"],
    answer: "index.html"
  }
];

export default questions;
